    map['etag'] = etag;
    map['nextPageToken'] = nextPageToken;
    if (pageInfo != null) {
      map['pageInfo'] = pageInfo?.toJson();
    }
    if (videos != null) {
      map['items'] = videos?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

